import "./featured.scss"
import MoreVertIcon from '@mui/icons-material/MoreVert';

const Featured = () => {
  return (
    <div className="featured">
      <div className="top">
        <h1 className="title">Total Sales since 2013</h1>
        <MoreVertIcon/>
      </div>
      <div className="bottom"></div>
    </div>
  )
}

export default Featured
